import React, { Component } from 'react';
import './Contact.css';

class Contact extends Component {
    render() {
        return (
            <div id="contact">
                <h2 className="section-title">Contact</h2>
                    <ul className="contact-list">
                        <li><a href="mailto:dandrecampbell5@gmail.com">Email</a></li>
                        <li><a href="https://discordapp.com/users/456580598480240672">Discord</a></li>
                        <li><a href="https://www.linkedin.com/in/dandre-campbell/">LinkedIn</a></li>
                        <li><a href="https://www.instagram.com/dandre_campbell/">Instagram</a></li>
                    </ul>
            </div>
        )
    }
}

export default Contact;
